import { Title, Video } from '../Components';
import './CSS/Konfliktloesung.css'

export default function Konfliktloesung(){
    return (
        <>
            <Title title="Biblische Konfliktlösung"/>
            <div class="body">
                <LatestVideos/>
            </div>
        </>
    );
}

function LatestVideos(){
    return (
        <div className="videosPanel">
            <VideoEntry url="Afa8JEXEbnU" title="Einführung" subtitle="1. Teil: Biblische Konfliktlösung"/>
            <VideoEntry url="AfndU9ztbN4" title=""/>
            <VideoEntry url="FgqP9SjM7I8"/>
            <VideoEntry url="6-8pZuSze3I"/>
            <VideoEntry url="ZQob38KTdL8"/>
            <VideoEntry url="Qn48qraaDrs"/>
        </div>
    );

            /*<VideoPlaylist vids={[
                {title: "1. Teil: Biblische Konfliktlösung / Einführung - Mike Leister", link: "https://www.youtube.com/watch?v="},
                {title: "2. Teil: Biblische Konfliktlösung / Gib Gott die Ehre - Mike Leister", link: "https://www.youtube.com/watch?v="},
                {title: "3. Teil: Biblische Konfliktlösung / Greif zum Balken in deinem Auge - Mike Leister", link: "https://www.youtube.com/watch?v="},
                {title: "4. Teil: Biblische Konfliktlösung / Gebrauche Sanftmut zur Zurechtweisung A - Mike Leister", link: "https://www.youtube.com/watch?v="},
                {title: "4. Teil: Biblische Konfliktlösung / Gebrauche Sanftmut zur Zurechtweisung B - Mike Leister", link: "https://www.youtube.com/watch?v="},
                {title: "5. Teil: Biblische Konfliktlösung / Geh hin und versöhne dich - Mike Leister", link: "https://www.youtube.com/watch?v="}
            ]}/>*/
}

function VideoEntry(params){
    return(
        <div className="videoEntry">
            <div className="videoContainer">
                <Video url={params.url}/>
            </div>
            <h2>{params.title}</h2>
            <h3>{params.subtitle}</h3>
        </div>
    );
}
